import React from 'react';
import '../../../App.css';
import '../../HeroSection.css';
import Dropdown from 'react-bootstrap/Dropdown';
// import { Link } from 'react-router-dom';

function ParSearch() {
    return (
        <div>
            <div className='hero-container'>
                <h1 className="register-title">Search for Studies</h1>
                <form action="/participant-search" method="POST">
                    <div class="form-container">
                        {/* <div class="form-group"> */}
                            <center>
                            <input class="input-box" name="Search" type="text" id="search_query" ></input>
                            <input type="submit" value="search_query" id="sendToServerButton"></input>
                            </center>
                        </div>
                    {/* </div> */}


                </form>
            </div>

        </div>
    )
}

export default ParSearch
